cypher:
CREATE (factory:Factory {id: 'example-factory-id', Factory: 'example-factory', Location: 'example-location'});
CREATE (machine:Machine {id: 'example-machine-id', Machine Type: 'example-machine type', Machine Utilization (%): 'example-machine utilization (%)', Machine Downtime (hours): 'example-machine downtime (hours)'});
CREATE (batch:Batch {id: 'example-batch-id', Batch: 'example-batch', Batch Quality (Pass %): 'example-batch quality (pass %)', Cycle Time (minutes): 'example-cycle time (minutes)'});
CREATE (shift:Shift {id: 'example-shift-id', Shift: 'example-shift', Operator Experience (years): 'example-operator experience (years)', Team Size: 'example-team size'});
CREATE (supplier:Supplier {id: 'example-supplier-id', Supplier: 'example-supplier', Supplier Delays (days): 'example-supplier delays (days)', Raw Material Quality: 'example-raw material quality'});
CREATE (financial:Financial {id: 'example-financial-id', Cost of Downtime ($): 'example-cost of downtime ($)', Revenue ($): 'example-revenue ($)', Profit Margin (%): 'example-profit margin (%)'});
CREATE (production:Production {id: 'example-production-id', Production Volume (units): 'example-production volume (units)', Defect Rate (%): 'example-defect rate (%)'});
CREATE (environment:Environment {id: 'example-environment-id', Energy Consumption (kWh): 'example-energy consumption (kwh)', Energy Efficiency Rating: 'example-energy efficiency rating', CO2 Emissions (kg): 'example-co2 emissions (kg)'});
CREATE (process:Process {id: 'example-process-id', Temperature (C): 'example-temperature (c)', Pressure (psi): 'example-pressure (psi)', Chemical Ratio: 'example-chemical ratio'});
MATCH (shift:Shift {id: 'example-shift-id'}), (machine:Machine {id: 'example-machine-id'}) CREATE (shift)-[r:OPERATES]->(machine);
MATCH (machine:Machine {id: 'example-machine-id'}), (batch:Batch {id: 'example-batch-id'}) CREATE (machine)-[r:PRODUCES]->(batch);
MATCH (machine:Machine {id: 'example-machine-id'}), (factory:Factory {id: 'example-factory-id'}) CREATE (machine)-[r:LOCATED_IN]->(factory);
MATCH (supplier:Supplier {id: 'example-supplier-id'}), (factory:Factory {id: 'example-factory-id'}) CREATE (supplier)-[r:SUPPLIES]->(factory);
MATCH (machine:Machine {id: 'example-machine-id'}), (environment:Environment {id: 'example-environment-id'}) CREATE (machine)-[r:GENERATES]->(environment);
MATCH (machine:Machine {id: 'example-machine-id'}), (process:Process {id: 'example-process-id'}) CREATE (machine)-[r:USES]->(process);
MATCH (batch:Batch {id: 'example-batch-id'}), (financial:Financial {id: 'example-financial-id'}) CREATE (batch)-[r:RESULTS_IN]->(financial);
MATCH (batch:Batch {id: 'example-batch-id'}), (production:Production {id: 'example-production-id'}) CREATE (batch)-[r:PRODUCES]->(production);
